import './marks.styles.css'
import MarksCard from '../marks-card/marks-card.component'
import { useContext } from 'react'
import { DataContext } from '../../contexts/data.context'
const Marks = () => {  
    const {data} = useContext(DataContext)
    const semisters = data['19EM1A0501']['marks'].sort((a, b) => a.item.timeM > b.item.timeM ? 1:-1)
    console.log(semisters)
    return(
        <div className="marks">
        {
            Object.keys(semisters).map(sem =>{
                return <MarksCard sem ={semisters[sem]}/>}
               
            )
        }
        </div>
    )
}


export default Marks
